Day 7 - September 5, 2020

TRIDUUM NOVENA - Day 7, Short Novena Prayer
Lord Jesus Christ, Son of the Father
May the Holy Spirit give us peace.
As we prepare for the Nativity of your Mother,
may she intercede for our prayers.
May she be our Mediatrix. Amen.

Mary to me is the embodiment of Faith, faith to God and His words. Abraham is the father of all who believes because he followed the words of God and was certain to his faith, he was even ready to sacrifice his only son just to follow God‚Äôs will. Abraham did this but he had some hesitations and encountered bumps while doing his mission. Mary, on the other hand, showed her faith with dignity and precedence. She was taken aback by the greeting of the Angel but was not scared at all. She showed that even with her youth and virginity, she has more profound faith than any other people from the older generations. She immediately said ‚Äúyes‚Äù to the words of the angel, the message from God, even if judgement might come afterwards, even if she is not sure about what will Joseph think, about how their community will feel. Mary, as the mother of God, should be the role model of our Christian faith. 

- Elvin Aizly G. Carde√±o, Day 7

